import React from "react";

const PercentageCell = ({ percent }) => {
   const style = {
      display: "block",
      width: "100%",
      height: "100%",
      background:
         "linear-gradient(bottom to top ,rgba(0,0,0,.7) 0%,rgba(0,0,0,.3) 100%) no-repeat",
      backgroundSize: `100% ${percent}% `,
   };
   return (
      <span style={style} className="static-cell">
         {percent}%
      </span>
   );
};

export default PercentageCell;
